import React, { useEffect, useState } from 'react';
import { Card, Container } from 'react-bootstrap';

function DisplayEvents() {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    // Simulated API call to fetch events data
    const fetchEvents = async () => {
      try {
        // Replace the API_URL with your actual API endpoint
        const response = await fetch('https://atsiskaitomas-default-rtdb.europe-west1.firebasedatabase.app/events/-NYbLi2Al6JKltzmINHt');
        const data = await response.json();
        setEvents(data);
      } catch (error) {
        console.error('Error fetching events data:', error);
      }
    };

    fetchEvents();
  }, []);

  return (
    <Container className="mt-5">
      <h1>Display Events</h1>
      <div>
        {events.map((event) => (
          <Card key={event.id} className="mb-3">
            <Card.Body>
              <Card.Title>{event.title}</Card.Title>
              <Card.Text>
                <strong>Category:</strong> {event.category}
              </Card.Text>
              <Card.Text>
                <strong>Time:</strong> {event.time}
              </Card.Text>
              <Card.Text>
                <strong>Place:</strong> {event.place}
              </Card.Text>
              <Card.Text>
                <strong>Image:</strong> {event.img}
              </Card.Text>
            </Card.Body>
          </Card>
        ))}
      </div>
    </Container>
  );
}

export default DisplayEvents;
